import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

//CSS
import './App.css';
import React from 'react';
import Menu from './components/Menu.js';

function App() {
  return (
    <Container fluid style={{padding:'0'}}>

      <Row>

        {/* Left Side Menu */}
        <Col className="sidebar" xs sm md lg xl xxl={2}>
            <Menu/>
        </Col>


        {/* Main Content */}
        <Col className="main-content" xs sm md lg xl xxl={10}>

        </Col>

      </Row>

    </Container>
  );
}

export default App;
